INSERT INTO `param_perfil_inves` (`id_perfil_inv`, `id_investigacion`, `id_rol_inv`, `perfil`, `objeto`, `estado`) VALUES
(1, 1, 4, 'Terminacin y aprobacin de estudios de educacin universitaria en: economa, economa industrial, administracin de empresas, administracin financiera, administracin de negocios, administracin financiera y de negocios internacionales, contadura, estadstica, finanzas y negocios Internacionales o en ingeniera industrial, ingeniera civil, ingeniera electrnica  o ingeniera  de sistemas y 1 ao de experiencia relacionada, y este en capacidad de realizarlas.\r\nOcho (8) semestres universitarios cursados y aprobados en: economa, economa industrial, administracin de empresas, administracin financiera, administracin de negocios, administracin financiera y de negocios internacionales, contadura, estadstica, finanzas y negocios Internacionales o en ingeniera industrial, ingeniera civil, ingeniera electrnica  o ingeniera  de sistemas y 18 meses de experiencia relacionada, y este en capacidad de realizarlas.\r\nTtulo de formacin tecnolgica en: economa, economa industrial, administracin de empresas, administracin financiera, administracin de negocios, administracin financiera y de negocios internacionales, contadura, estadstica, finanzas y negocios Internacionales o en ingeniera industrial, ingeniera civil, ingeniera electrnica  o ingeniera  de sistemas y 2 aos de experiencia relacionada, y este en capacidad de realizarlas.\r\nTtulo de formacin tcnica en: economa, economa industrial, administracin de empresas, administracin financiera, administracin de negocios, administracin financiera y de negocios internacionales, contadura, estadstica, finanzas y negocios Internacionales o en ingeniera industrial, ingeniera civil, ingeniera electrnica  o ingeniera  de sistemas y 3 aos de experiencia relacionada, y este en capacidad de realizarlas.\r\n', 'Prestacin de servicios de apoyo a la gestin para coordinar las actividades de seguimiento y control de los procesos preoperativos y operativos como la notificacin, recoleccin, validacin, consistencia de informacin y control de calidad, hasta la transferencia de informacin a DANE Central, de la  Encuesta Anual de Comercio - EAC del ao estadstico de  2015, de las fuentes que le sean asignadas, durante la ejecucin del contrato.', 'AC'),
(2, 1, 6, 'Ttulo de formacin tecnolgica en los ncleos bsicos del conocimiento en: economa, contadura pblica; ingeniera industrial y afines y en las carreras de administracin de empresas, administracin industrial, administracin empresarial, administracin en finanzas y negocios internacionales, administracin financiera, negocios y finanzas internacionales, banca y finanzas e ingeniera de sistemas y 6 meses de experiencia relacionada, y este en capacidad de realizarlas.\r\nTtulo de formacin tcnica profesional en los ncleos bsicos del conocimiento en: economa, contadura pblica; ingeniera industrial y afines y en las carreras de administracin de empresas, administracin industrial, administracin empresarial, administracin en finanzas y negocios internacionales, administracin financiera, negocios y finanzas internacionales, banca y finanzas e ingeniera de sistemas y 9 meses de experiencia relacionada, y este en capacidad de realizarlas. \r\nCuatro (4) semestres universitarios cursados y aprobados en los ncleos bsicos del conocimiento en: economa, contadura pblica; ingeniera industrial y afines y en las carreras de administracin de empresas, administracin industrial, administracin empresarial, administracin en finanzas y negocios internacionales, administracin financiera, negocios y finanzas internacionales, banca y finanzas e ingeniera de sistemas y 1 ao de experiencia relacionada, y este en capacidad de realizarlas. \r\n', 'Prestaciones de servicios de apoyo a la gestin para adelantar los procesos preoperativo y operativos de la notificacin, crtica, captura, anlisis de consistencia de la informacin y asesora a las fuentes en el diligenciamiento de la Encuesta Anual de Comercio del ao estadstico 2015, de las fuentes que les sean asignadas durante la ejecucin del contrato.', 'AC');
